pub fn get_impala_root_grammar_id() -> GrammarId {
    GrammarId(1486)
}
pub fn get_impala_root_grammar_table() -> RootGrammar {
    RootGrammar {
        grammar_id: get_impala_root_grammar_id(),
        tables: &IMPALA_TABLES,
    }
}
pub fn get_impala_root_grammar() -> RootGrammar {
    get_impala_root_grammar_table()
}
